  `isSend` bit(1) DEFAULT b'0' COMMENT '是否已经发送',
  `trend` tinyint(1) DEFAULT NULL COMMENT '在最低价监视日子内趋势 -1跌的日子比较多  0 震荡  1上涨的日子比较多',
  `lowHis` float DEFAULT NULL COMMENT '历史最低价',
